export default (function(a,b,c,d,e,f,g,h,i,j){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:f,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:d,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:d,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:d,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:f,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}}],meta:{pagination:{page:g,pageSize:25,pageCount:g,total:5}}},bmiJkEbulP:{data:{id:2573,attributes:{imdbId:"tt0430674",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BMTY1MjAyMjAxMl5BMl5BanBnXkFtZTcwMjcwMDIzMQ@@._V1_SX300.jpg",type:d,ratings:[{Source:"Internet Movie Database",Value:"6.0\u002F10"},{Source:"Rotten Tomatoes",Value:"40%"}],item_lang:{data:{id:3236,attributes:{title:a,plot:"A tale about two young boys, Prosper and Bo, who flee to Venice after being orphaned and dumped in the care of a cruel auntie. Hiding in the canals and alleyways of the city, the boys are befriended by a gang of young urchins and their enigmatic leader, the Thief Lord. From their home base of an old cinema theater, the children steal from the rich to support themselves and soon capture the interest of a bumbling detective. However, a greater threat to the children is something from a forgotten past-- a beautiful magical treasure with the power to spin time itself.",slug:"the-thief-lord"}}},books:{data:[{id:12367,attributes:{title:a,description:"The enchanting international bestseller with bonus back matter and a beautiful new cover!Two orphaned brothers, Prosper and Bo, have run away to Venice, where crumbling canals and misty alleyways shelter a secret community of street urchins. Leader of this motley crew of lost children is a clever, charming boy with a dark history of his own: He calls himself the Thief Lord.Propser and Bo relish their new \"family\" and life of petty crime. But their cruel aunt and a bumbling detective are on their trail. And posing an even greater threat to the boys' freedom is something from a forgotten past: a beautiful magical treasure with the power to spin time itself.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=z87kIhZ8ZWoC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[b],firstBook:true,published:h,publisher:i,subtitle:c}},{id:12368,attributes:{title:a,description:"Two brothers, having run away from the aunt who plans to adopt only the younger one, are sought by a detective hired by their aunt, but they find protection from a gang of Venetian street children and their leader, the Thief Lord.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=ybo6nwEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:e,published:"2010-05-01",publisher:j,subtitle:c}},{id:12369,attributes:{title:a,description:"Amid the crumbling splendour of wintertime Venice, two orphans are on the run. The mysterious Thief Lord offers shelter, but a terrible danger is gathering force...",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=jt1GBAAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[b],firstBook:e,published:"2013-10-03",publisher:j,subtitle:c}},{id:12370,attributes:{title:a,description:"Use Novel-Ties Â® study guides as your total guided reading program. Reproducible pages in chapter-by-chapter format provide you with the right questions to ask, the important issues to discuss, and the organizational aids that help students get the most out of each book they read.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=rDSMPwAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:["Carol Alexander",b],firstBook:e,published:"2004-09-01",publisher:"Learning Links",subtitle:c}},{id:12371,attributes:{title:"Inkdeath (Inkheart Trilogy, Book 3)",description:"The masterful conclusion to the epic, award-winning, NYT bestselling INKHEART trilogy by internationally acclaimed author Cornelia Funke.The Adderhead--his immortality bound in a book by Meggie's father, Mo--has ordered his henchmen to plunder the villages. The peasants' only defense is a band of outlaws led by the Bluejay--Mo's fictitious double, whose identity he has reluctantly adopted. But the Book of Immortality is unraveling, and the Adderhead again fears the White Women of Death. To bring the renegade Bluejay back to repair the book, the Adderhead kidnaps all the children in the kingdom, dooming them to slavery in his silver mines unless Mo surrenders. First Dustfinger, now Mo: Can anyone save this cursed story?",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=Fv6yoNVY63kC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[b],firstBook:e,published:h,publisher:i,subtitle:c}}]}}},meta:{}}},prerenderedAt:1681309122079}}("The Thief Lord","Cornelia Funke","","movie",null,"series",1,"2011-10-01","Scholastic Inc.","Chicken House"))